function Password(props) {

    const {delta} = props
    const passVal = ''

    function PassSrrength(){
        if(delta < 100){
            passVal =  "weak";
        }
        if(delta >= 100 && delta <= 1000000) {
            passVal =  "medium"
        }
        if(delta > 1000000){
            passVal = "strong!"
        }

        return passVal
    }

  return (
    <div className="isValidPass">
        Password Strength: {PassSrrength}
    </div>
  );
}

export default Password;
